import{_ as o,o as s,c as a,z as e,a as t}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 30-16 Books and maps of committees; original bills.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/30-16.md","filePath":"vacode/30-16.md"}'),i={name:"vacode/30-16.md"},r=e("h1",{id:"§-30-16-books-and-maps-of-committees-original-bills",tabindex:"-1"},[t("§ 30-16 Books and maps of committees; original bills. "),e("a",{class:"header-anchor",href:"#§-30-16-books-and-maps-of-committees-original-bills","aria-label":'Permalink to "§ 30-16 Books and maps of committees; original bills."'},"​")],-1),l=e("p",null,"It shall be the duty of the Clerk of the Senate and of the Clerk of the House of Delegates, respectively, to take charge of and keep, during the recess of the General Assembly, all the books and maps belonging to the several standing committees of their respective houses, and to deliver the same at the commencement of each session to the clerks or chairmen of such committees, who shall return them to the Clerks of the two houses at the end of the session. They shall keep all original bills and resolutions offered in their respective houses until the close of the session of the General Assembly next succeeding the session at which they were offered, at which time they shall be transferred to The Library of Virginia for archival deposit.",-1),n=e("p",null,[t("Code 1919, § 309; 2000, c. "),e("a",{href:"http://lis.virginia.gov/cgi-bin/legp604.exe?001+ful+CHAP0373",target:"_blank",rel:"noreferrer"},"373"),t(".")],-1),h=[r,l,n];function c(d,m,f,p,_,g){return s(),a("div",null,h)}const k=o(i,[["render",c]]);export{u as __pageData,k as default};
